const MY_KEY = '0add6da0-058c-491e-b604-c77b7ca63e75';

export default async function userFetch(plataform, user) {
    const URL = `https://api.fortnitetracker.com/v1/powerrankings/${plataform}/BR/${user}`;

    try {
        const response = await fetch(URL, {
            headers: {
                "TRN-Api-Key": MY_KEY,
            }
        })
        const data = await response.json();
        return data;
    } catch (error) {
        return Error(error)
    }


}
